import {Component} from 'react'
import './card.styles.css'

class Card extends Component{

    render(){
        const {props} = this
        return(
<div key={props.id} className={`card-container ${props.className}`}>
                <img alt={`monster ${props.name}`}
                    src={`${`https://robohash.org/${props.id}?set=set2`}`} />
                    <h2>{props.name}</h2>
                    <p>{props.email}</p>
            </div>
        )
    }
}
export default Card
